$query = $db->query("SELECT * FROM cryptoacc WHERE name='ethereum'");
$row = $query->fetch_assoc();
$code = $row['crypto_code'];
$qr = $row['crypto_code'];


function getCoinPrice($coin_id, $vs_currency) {
  $url = "https://api.coingecko.com/api/v3/simple/price?ids={$coin_id}&vs_currencies={$vs_currency}";
  $response = file_get_contents($url);
  
  if ($response === false) {
      return false;
  }
  
  $data = json_decode($response, true);
  
  if (!isset($data[$coin_id][$vs_currency])) {
      return false;
  }
  
  return $data[$coin_id][$vs_currency];
}

if ($_SERVER['REQUEST_METHOD'] === 'POST') {
  $lira_amount = $_POST['amount'];
  $_SESSION['lira_amount'] = $lira_amount;
  $coin_id = "ethereum";
  $vs_currency = "try";

  $coin_price = getCoinPrice($coin_id, $vs_currency);
  $formatted_coin_price = number_format($coin_price, 6);
  $_SESSION['frmt2'] = $formatted_coin_price;

  if ($coin_price === false) {
    echo "Coin fiyatı alınamadı.";
  } else {
    $coin_amount = $lira_amount / $coin_price;
    $formatted_amount = number_format($coin_amount, 6);
    $_SESSION['frmt'] = $formatted_amount;
  }
}
global $lira_amount;

