        <script>
         function countdown(duration, display) {
  var timer = duration, minutes, seconds;
  var intervalId = setInterval(function () {
    minutes = parseInt(timer / 60, 10);
    seconds = parseInt(timer % 60, 10);

    minutes = minutes < 10 ? "0" + minutes : minutes;
    seconds = seconds < 10 ? "0" + seconds : seconds;

    display.textContent = minutes + ":" + seconds;

    var progressWidth = (timer / duration) * 100;
    document.getElementById('progress2').style.width = progressWidth + "%";

    if (timer <= 0) {
      clearInterval(intervalId);
      display.textContent = "00:00"; // İsteğe bağlı olarak süre dolunca görüntülenecek son değeri ayarlayabilirsiniz

      Swal.fire({
        icon: 'error',
        title: 'Süre Doldu',
        text: 'Ana menüye yönlendiriliyorsunuz. Yeni Bir Form Oluşturun',
        showConfirmButton: false,
        timer: 3000,
        timerProgressBar: true,
        didClose: function () {
          // Ana menüye yönlendirme kodunu buraya ekleyin
          window.location.href = '/?deposit'; // Ana menüye yönlendirme yapılacak sayfanın adresini buraya ekleyin
        }
      });
    }
    timer--;
  }, 1000);
}

window.onload = function () {
  var display = document.getElementById('time');
  var duration = 900; // 15 dakika = 900 saniye

  countdown(duration, display);
};

function copyData(data) {
  var dummyElement = document.createElement('textarea');
  dummyElement.value = data;
  dummyElement.setAttribute('readonly', '');
  dummyElement.style.position = 'absolute';
  dummyElement.style.left = '-9999px';
  document.body.appendChild(dummyElement);
  dummyElement.select();
  document.execCommand('copy');
  document.body.removeChild(dummyElement);

  Swal.fire({
    icon: 'success',
    title: 'Kopyalandı',
    showConfirmButton: false,
    timer: 2000
  });
}

